const StatCard = ({ title, value }) => {
  return (
    <div className="bg-white rounded-xl shadow p-4">
      <h4 className="text-gray-500 text-sm">{title}</h4>
      <p className="text-2xl font-bold mt-2">{value}</p>
    </div>
  );
};

export default StatCard;
